package de.upb.crc901.mlpipeline_evaluation;

public class InvalidDatasetOriginException extends Exception {

	/**
	 * Automatically generated version UID for serialization.
	 */
	private static final long serialVersionUID = 4082480943566557877L;

	public InvalidDatasetOriginException(final String msg) {
		super(msg);
	}

	public InvalidDatasetOriginException(final Throwable cause) {
		super(cause);
	}

	public InvalidDatasetOriginException(final String msg, final Throwable cause) {
		super(msg, cause);
	}

}
